package Entity;/** * @author xmy * @date 2021/3/8 5:32 下午 */public class StudentCard {    private int cardId;    private String cardInfo;    public void StudentCard() {    }    public StudentCard(int cardId, String cardInfo) {        this.cardId = cardId;        this.cardInfo = cardInfo;    }    public int getCardId() {        return cardId;    }    public void setCardId(int cardId) {        this.cardId = cardId;    }    public String getCardInfo() {        return cardInfo;    }    public void setCardInfo(String cardInfo) {        this.cardInfo = cardInfo;    }}